import {Form} from 'antd';
import styled from 'styled-components';
import {FormProps} from "antd";


const CustomForm: React.FC<FormProps> = styled(Form)
    `
    width: 75%;
    border: 2px solid black;
    border-radius: 3px;
`
;

export default CustomForm;
